import React from 'react'

const TableData = ({bookingData}) => {
    // const [appointments, setAppointments] = useState([]);    
    return (
        <div>
        <table>
          <thead>
            <tr>
              <th>Username</th>
              <th>Account ID</th>
              <th>Doctor Email</th>
              <th>Doctor Timezone</th>
              <th>Booking ID</th>
              <th>Order ID</th>
              {/* Add more headers as needed */}
              <th>Customer Name</th>
              <th>Customer Phone</th>
              <th>Location</th>
              <th>Meeting Start Time</th>
              <th>Meeting End Time</th>
              <th>Duration</th>
              <th>Earnings</th>
              <th>Transaction Status</th>
              <th>Booking Status</th>
            </tr>
          </thead>
          <tbody>
            {bookingData.map((appointment) => (
              <tr key={appointment._id}>
                <td>{appointment.Username_doctor}</td>
                <td>{appointment.accId}</td>
                <td>{appointment.doctorEmail}</td>
                <td>{appointment.doctorTimezone}</td>
                <td>{appointment.bookedServicesData[0].bookingId}</td>
                <td>{appointment.bookedServicesData[0].orderId}</td>
                {/* Add more cells as needed */}
                <td>{appointment.bookedServicesData[0].customerName}</td>
                <td>{appointment.bookedServicesData[0].customerPhoneNumber}</td>
                <td>
                   {appointment.bookedServicesData[0].location ? (
                     `${appointment.bookedServicesData[0].location.country}, ${appointment.bookedServicesData[0].location.city}, ${appointment.bookedServicesData[0].location.state}`
                    ) : (
                      'Location not available'
                    )}
                </td>
                <td>{appointment.bookedServicesData[0].meetingStartTime}</td>
                <td>{appointment.bookedServicesData[0].meetingEndTime}</td>
                <td>{calculateDuration(appointment.bookedServicesData)}</td>
                <td>{`${appointment.bookedServicesData[0].amount} ${appointment.bookedServicesData[0].currency}`}</td>
                <td>{appointment.bookedServicesData[0].transactionStatus}</td>
                <td>{appointment.bookedServicesData[0].bookingStatus}</td>
              </tr>
            ))}
          </tbody>
        </table>
        </div>
      );
    };
    
    const calculateDuration = (bookingData) => {
        
      
        if (!bookingData[0].meetingStartTime || !bookingData[0].meetingEndTime) {
          return 'Duration not available';
        }
      
        const startTime = new Date(bookingData[0].meetingStartTime);
        const endTime = new Date(bookingData[0].meetingEndTime);
      
        const durationInMilliseconds = endTime - startTime;
      
        const hours = Math.floor(durationInMilliseconds / 3600000);
        const minutes = Math.floor((durationInMilliseconds % 3600000) / 60000);
      
        return `${hours} hours ${minutes} minutes`;
      };
    
export default TableData
